import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';

// hooks
import { useFetch } from '../../../hooks';
// compoments
import IntitutionInformation from './IntitutionInformation';

const useStyles = makeStyles({
  root: {
    minWidth: 275,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

const CardInstitution = () => {
  const classes = useStyles();
  const { data } = useFetch('/institutions/group');
  return data.map((information) => (
    <Card className={classes.root}>
      <CardHeader
        titleTypographyProps={{ variant: 'h6' }}
        style={{ backgroundColor: '#FF6F00', color: 'white' }}
        title={`${information.buildingName}`}
      >
        Region: {information._id}
      </CardHeader>
      <IntitutionInformation />
    </Card>
  ));
};
export default CardInstitution;
